function App() {
    return (
      <BrowserRouter>
        <Topbar />
        <div className="container">
          <Sidebar />
          <Home />
          <Routes>
            <Route exact path="/" Component={Home}/>
            <Route exact path="/users" Component={User}/>
          </Routes>
        </div>
      </BrowserRouter>
    );
  }

export default App;
